def unique(input):
    uchars = set()
    for c in input:
        if c in uchars:
            return False
        uchars.add(c)
    return True  

answer = 0
messageanswer = 0
for i in messagedata:
    if unique(i):
        messageanswer = i
        break
for i in newdata:
    if unique(i):
        answer = i
